DEFAULT_ORIGIN="http://localhost:3000";RENDER_CALLBACK_NAME="renderData";POST_DATA_MESSAGE_TYPE="postData";CALLBACK_MESSAGE_TYPE="runCallback";Vida={};Vida.ISender=function(e,t){var n=document.getElementById(e);if(n){this.receiver=n.contentWindow;this.origin=t||DEFAULT_ORIGIN}else{console.log("Cannot find iframe. Must use iframe id to initialize.")}};Vida.ISender.prototype.post=function(e){var t={type:POST_DATA_MESSAGE_TYPE,data:e};this.receiver.postMessage(JSON.stringify(t),this.origin)};Vida.ISender.prototype.render=function(){this.runCallback(RENDER_CALLBACK_NAME)};Vida.ISender.prototype.runCallback=function(e){var t={type:CALLBACK_MESSAGE_TYPE,data:e||""};this.receiver.postMessage(JSON.stringify(t),this.origin)};Vida.ISender.prototype.postRender=function(e){if(e){this.post(e);this.render()}}